import './Contacts.css';
import discord from './assets/discord.png';
import instagram from './assets/instagram.png';
import telegram from './assets/telegram.png';

function Contacts() {
  return (
    <main className="Contacts">
      <div className="card">
        <h1 className="title">Entre em Contato</h1>
        <h2 className="undertitle">Para respostas imediatas, entre em contato via discord, ou instagram</h2>
        <ul className="buttons"> 
          <li><a target="_blank" href="https://discord.com/users/247726496435666944/"><img title="Discord" className="img" src={discord} />Discord</a></li>
          <li><a target="_blank" href="https://www.instagram.com/gustavo.lass/"><img title="Instagram" className="img" src={instagram} />Instagram</a></li>
          <li><a href=""><img title="Telegram" className="img" src={telegram} />Telegram</a></li>
        </ul>
      </div>
    </main>
  );
}

export default Contacts;
